import React from 'react';
import { BrowserRouter, NavLink, Route, Switch } from 'react-router-dom';
import Info from './components/info';
import Internship from './components/internship';
import Networking from './components/networking';
import Partner from './components/partner';
import Project from './components/project';



function Admin() {

    return (
        <BrowserRouter>
                <ul className='web'>
          <li><NavLink exact to='/home'>홈</NavLink></li>
          <li><NavLink exact to='/internship'>UKOV 후기</NavLink></li>
          <li><NavLink exact to='/partner'>다양한 파트너사</NavLink></li>
          <li><NavLink exact to='/networking'>네트워킹</NavLink></li>

          <li><NavLink exact to='/prject'>미니프로젝트</NavLink></li>

        </ul>
      <Switch>
        <Route exact path={['/', '/home']}>
            <Info />
        </Route>
        <Route exact path='/internship'>
            <Internship />
        </Route>
        <Route exact path='/Partner'>
            <Partner />
        </Route>
        <Route exact path='/Project'>
            <Project />
        </Route>
        <Route exact path='/Networking'>
            <Networking />
        </Route>
      </Switch>
        </BrowserRouter>    
        );
}


export default Admin;
